const GetLotr = () => {

    const [lotr, setLotr] = useState([])

    useEffect( () => {

        const headers = {
            'Accept': 'application/json',
            'Authorization': 'Bearer 36H_uSF2UL6WB97Foiob'
          }

        const getLotr = async () => {
            let data = await fetch('https://the-one-api.dev/v2/quote')
            let lotr = await data.json()
            setLotr(lotr)
        }

        getLotr()
    }, [])



    return (
        <ul>
            {lotr.map(lotr => <li>{lotr.title}</li>)}
        </ul>
    )
}

export default App;
